import styled from 'styled-components';
import { fetchLogin } from '../../redux/authSlice';

import Navbar from '../../components/Navbar/navbar';

export default function Login() {
	const [isMember, setIsMember] = useState(true);
	const [name, setName] = useState('');
	const [email, setEmail] = useState('');
	const [password, setPassword] = useState('');
	const [confirmPassword, setConfirmPassword] = useState('');

	async function handleLogin() {
		useAppDispatch(fetchLogin());
	}

	const FormContainer = styled.div`
		max-width: 100%;
		display: flex;
		height: 90vh;
		width: 100%;
		justify-content: center;
		align-items: center;

		.form-wrapper {
			display: block;
			width: 25rem;
			height: 40rem;
			background-color: pink;
			box-shadow: -1px 0px 28px 9px rgba(230, 230, 230, 0.75);
			-webkit-box-shadow: -1px 0px 28px 9px rgba(230, 230, 230, 0.75);
			-moz-box-shadow: -1px 0px 28px 9px rgba(230, 230, 230, 0.75);

			form {
				padding: 5rem;
			}
			span {
				display: block;
				text-align: left;
				margin-bottom: 2rem;
				width: 100%;

				input {
					width: 100%;
				}
			}
		}
	`;

	return (
		<FormContainer>
			<div className='form-wrapper'>
				<h3>{isMember ? 'Login' : 'Sign Up'}</h3>
				<button onClick={() => handleLogin()}></button>
				{/* <form onSubmit={(e) => handleLogin(e)}>
