					</span>
					<span>
						<label htmlFor='confirmpassword'>Confirm Password:</label>
						<br></br>
						<input type='password' id='confirmpassword' onChange={(e: React.ChangeEvent<HTMLInputElement>) => setConfirmPassword(e.target.value)} />
